// frontend/src/admin/pages/users/AddUser.jsx
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { FiArrowLeft } from 'react-icons/fi';

export default function AddUser() {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: ''
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    // Submit logic here
    navigate('/admin/users'); // Return to user list
  };

  return (
    <div className="p-6">
      <div className="mb-6">
        <button 
          onClick={() => navigate(-1)}
          className="flex items-center gap-2 text-amber-900 hover:text-rose-800"
        >
          <FiArrowLeft /> Back to Users
        </button>
      </div>

      <div className="max-w-2xl mx-auto bg-white rounded-xl shadow-sm border border-rose-100 p-6">
        <h1 className="text-2xl font-serif font-bold text-rose-800 mb-6">Add New User</h1>
        
        <form onSubmit={handleSubmit}>
          {/* Form fields same as modal version */}
          <div className="flex justify-end space-x-3 mt-8">
            <button
              type="button"
              onClick={() => navigate(-1)}
              className="px-4 py-2 border border-rose-200 text-amber-900 rounded-lg hover:bg-rose-50"
            >
              Cancel
            </button>
            <button
              type="submit"
              className="px-4 py-2 bg-rose-700 text-white rounded-lg hover:bg-rose-800"
            >
              Create User
            </button>
          </div>
        </form>
      </div>
    </div>
  );
}
